import React, { Component } from 'react'
import MainTitle from '../../../container/MainTitle'
import Items from './Items';

class TopStreams extends Component {
    constructor() {
        super();
        this.mainTitle = {
            first: "streams",
            title: "top"
        }
        this.item = {
            name: ["LahutaM","Kengan","Areluwa"," Omeg","GangTeam"],
            profile: [Avatar1,Avatar2,Avatar3,Avatar4, Avatar1],
        }
    }
    generateItem(i) {
        return <Items img={this.item.img[i]} name={this.item.name[i]} band={this.item.band[i]} stars={this.item.stars[i]} downloads={this.item.downloads[i]}/>;
    }
    render() {
        return (
            <div className='top-streams bg-darkAlt rounded-5 p-4 position-relative'>
                <MainTitle first={this.mainTitle.first}>{this.mainTitle.title}</MainTitle>
                <div className='items mt-4 d-flex flex-column gap-5 mb-2'>
                    {/* {this.generateItem(0)}
                    {this.generateItem(1)}
                    {this.generateItem(2)} */}
                </div>
            </div>
        )
    }
}

export default TopStreams;
